import React from 'react';

const h = React.createElement;


export default function ProgressBar(props){

    React.useEffect(() => {
        this.props = props;
        this.steps=[0,1,2,3,4];

        }, [props]);


        return h("div", {className:"ProgressBar"},
        <RenderProgress step = {this.step}/>
        );


    }

    function RenderProgress(step){
        return this.steps.forEach(val => {
            if (val === step){return <span classname="currentstep"></span>};
            return (<span classname="notcurrentstep"></span>);
        }) 
    }
